
#include <stdint.h>
#include <stdio.h>
#include "gte.h"

const char* testName = "";
bool testFailed = false;
int testFailedCount = 0;
int testPassedCount = 0;
uint32_t input[64];
uint32_t output[64];
uint32_t expectedOutput[64];

void gteClearAllRegs() {
  for (int i = 0; i<64; i++) {
    GTE_WRITE(i, 0);
  }
}

void TEST_BEGIN(const char* name) {
  testName = name;
  testFailed = false;
  gteClearAllRegs();
}

void TEST_END() {
  if (!testFailed) {
    testPassedCount++;
    return;
  }
  testFailedCount++;

  printf("\nAssertion failed (%s): \n", testName);
  printf("Differences:\n");
  printf("              received - expected\n");
  for (int i = 0; i<64; i++) {
    if (output[i] != expectedOutput[i]) {
      printf("%2d.         0x%08x - 0x%08x\n", i, output[i], expectedOutput[i]);
    }
  }
}

void WRITE(int reg, uint32_t value) {
  input[reg] = value;
  GTE_WRITE(reg, value);
}

void READ(int reg, uint32_t expected) {
  uint32_t value = GTE_READ(reg);
  output[reg] = value;
  expectedOutput[reg] = expected;
  if (value != expected) {
    testFailed = true;
  }
}

struct test_t {
    const char* name;
    uint32_t input[64];
    uint32_t opcode;
    uint32_t output[64];
};

